import React from 'react';
import axios from 'axios';

export default class PersonList extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get(`http://178.128.196.163:3000/api/records`)
      .then(res => {
        const persons = res.data;
        this.setState({ persons });
        console.log(persons);
      })
  }

  render() {
    return (
      <>
        {
          this.state.persons
            .map(person =>
              <tr key={person.id}>
                        <td>{person.data.name}</td>
                        <td>{person.data.age}</td>
                        <td>{person.data.email}</td>
                        <td><button className='btn btn-primary' onClick={()=>deleteFunc(person.id)}>Delete</button></td>
              </tr>
            )
        }
        </>
    )
  }
}
